    langs:
      - typeScript
    type: interface
    summary: >-
      A reference data set provides metadata about the events in an environment.
      Metadata in the

      reference data set will be joined with events as they are read from event
      sources. The metadata

      that makes up the reference data set is uploaded or modified through the
      Time Series Insights

      data plane APIs.
    extends:
      name: '@azure/arm-timeseriesinsights.TrackedResource'
    package: '@azure/arm-timeseriesinsights'
